function initMap(p,c,b) {
  
var p = [{lat: 43.05478, lng: -89.40216}, {lat: 43.05654, lng: -89.40424}, {lat: 43.05748, lng: -89.40402}, {lat: 43.059, lng: -89.4005}, {lat: 43.05729, lng: -89.39732}, {lat: 43.05719, lng: -89.39652}, {lat: 43.05739, lng: -89.39502}, {lat: 43.05739, lng: -89.38892}, {lat: 43.05865, lng: -89.38843}, {lat: 43.05852, lng: -89.38759}, {lat: 43.05875, lng: -89.38437}, {lat: 43.05829, lng: -89.38341}, {lat: 43.05829, lng: -89.38152}, {lat: 43.05679, lng: -89.37902}, {lat: 43.05569, lng: -89.37782}, {lat: 43.05267, lng: -89.38381}, {lat: 43.04959, lng: -89.38847}, {lat: 43.04919, lng: -89.39404}, {lat: 43.0495, lng: -89.3995}, {lat: 43.05037, lng: -89.4009}, {lat: 43.05478, lng: -89.40216}]
var b = {north:43.059, south:43.04919, west:-89.40424, east:-89.37782,}
var c = {lat:43.054095000000004, lng:-89.39103}
  
  var everythingElse = [ // covers the (mercator projection) world
    new google.maps.LatLng(85,180),
    new google.maps.LatLng(85,90),
    new google.maps.LatLng(85,0),
    new google.maps.LatLng(85,-90),
    new google.maps.LatLng(85,-180),
    new google.maps.LatLng(0,-180),
    new google.maps.LatLng(-85,-180),
    new google.maps.LatLng(-85,-90),
    new google.maps.LatLng(-85,0),
    new google.maps.LatLng(-85,90),
    new google.maps.LatLng(-85,180),
    new google.maps.LatLng(0,180),
    new google.maps.LatLng(85,180)];


  // Define the LatLng coordinates for the polygon's path.
var triangleCoords = p;

const map = new google.maps.Map(document.getElementById("map"), {
    mapId: "3782c2d2aeaec7e5", 
    center: c,
  });

map.fitBounds(b);
map.panToBounds(b);    

  neighMap = new google.maps.Polygon({
    paths: [everythingElse, triangleCoords],
    strokeOpacity: 0,
    strokeWeight: 0,
    fillColor: "#fff",
    fillOpacity: 1
  });

  neighMap.setMap(map);
}
